import {OnlyOwner} from "../hooks/hookAdmin"


export const Admin = () => {

    const hook = OnlyOwner()

    /*const fja = () => {
        hook.getBalance()
    }*/

    return (
        <>
            <div>STATE</div>
            <Button variant="outlined" size="large" onClick={() => hook.getBalance()}>GETBALANCE</Button>
            <div>START LOTTERY</div>
            <div>ENTER LOTTERY</div>
            <div>END LOTTERY</div>
        </>
    )
}
